import React from 'react';
import { CheckCircle, Download } from 'lucide-react';

const FormsView = ({ forms, showNotification }) => {
  const handleDownload = (formId) => {
    window.open(`http://localhost:8000/api/admin/download-completed-nda/${formId}`, '_blank');
    showNotification('Download started!', 'success');
  };

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <h2 className="text-2xl font-bold">Submitted NDA Forms</h2>
        <span className="text-sm text-gray-500">{forms.length} forms</span>
      </div>

      <div className="bg-white rounded-xl shadow-sm border">
        <table className="w-full">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Company</th>
              <th className="px-6 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Email</th>
              <th className="px-6 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Submitted</th>
              <th className="px-6 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Actions</th>
            </tr>
          </thead>
          <tbody className="divide-y">
            {forms.map(form => (
              <tr key={form.id} className="hover:bg-gray-50">
                <td className="px-6 py-4">
                  <div className="flex items-center gap-3">
                    <CheckCircle className="text-green-500" size={20} />
                    <span className="font-medium">{form.company_name}</span>
                  </div>
                </td>
                <td className="px-6 py-4 text-sm text-gray-600">{form.email}</td>
                <td className="px-6 py-4 text-sm text-gray-600">
                  {new Date(form.submitted_at).toLocaleDateString()}
                </td>
                <td className="px-6 py-4">
                  <button
                    onClick={() => handleDownload(form.id)}
                    className="flex items-center gap-2 px-3 py-1 text-blue-600 hover:bg-blue-50 rounded-lg"
                  >
                    <Download size={16} />
                    Download
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default FormsView;
